ES7特性

Array.prototype.includes

用来替代indexOf，检查数组中是否存在值

let arr = ['react', 'angular', 'vue']

// WRONG
if (arr.indexOf('react')) { // 0 == false
  console.log('Can use React') //  不会执行
}

// Correct
if (arr.indexOf('react') !== -1) {
  console.log('Can use React')
}

if (arr.includes('react')) {
  console.log('Can use React')
}

