async异步函数

由 async 关键字定义的函数声明定义了一个可以异步执行的函数，它返回一个 AsyncFunction 类型的对象

function fetchTextByPromise() {
  return new Promise(resolve => { 
    setTimeout(() => { 
      resolve("es8");
    }, 2000);
  });
}
async function sayHello() { 
  const externalFetchedText = await fetchTextByPromise();
  console.log(`Hello, ${externalFetchedText}`); // Hello, es8
}
sayHello();


共享内存与原子化

当内存被共享时，多个线程可以在内存中读写相同的数据。原子操作确保预测值的可读和可写，在下一个线程开启前操作未结束，不会导致开启新的线程发生中断。这一部分介绍了一个新的构造器ShareArrayBuffer和带有静态方法的名称空间对象Atomics。Atomic对象是一个类似于有很多方法的Math对象，可以向一个构造器一样去使用。

add / sub---add / 在一个特定位置上减去一个值
and/or/xor---与，或，异或
load---获取特定位置的值

